  \ of each test case contains three integers n, a and b (2 \u2264 n \u2264 10^5,\
  \ 0 \u2264 a,b \u2264 n).\n\nThe sum of n over all test cases doesn't exceed 10^5.\n\
  \nOutput\n\nFor each test case, if there is no permutation with the requested properties,\
  \ output -1.\n\nOtherwise, print the permutation that you are found. If there are\
  \ several such permutations, you may print any of them.\n\nExample\n\nInput\n\n\n\
  3\n4 1 1\n6 1 2\n6 4 0\n\n\nOutput\n\n\n1 3 2 4\n4 2 3 1 5 6\n-1\n\nNote\n\nIn the\
  \ first test case, one example of such permutations is [1, 3, 2, 4]. In it p_1 <\
  \ p_2 > p_3, and 2 is the only such index, and p_2> p_3 < p_4, and 3 the only such\
